 ('26', '26', 'en_us', 'Dance Marathon', NULL, '#000000', NULL, 'https://dancemarathon.uiowa.edu/', '[\"cmsIntegration\",\"design\",\"htmlCss\"]', 'A new website for the largest student organization at the University of Iowa.', NULL, NULL, NULL, '2016-07-24 14:55:53', '2016-07-24 14:55:53', 'f48a00eb-b916-4705-b72a-f27e8303b299'),
 ('27', '27', 'en_us', 'Office of Sustainability', NULL, '#000000', NULL, 'http://sustainability.uiowa.edu/', '[\"cmsIntegration\",\"design\",\"htmlCss\"]', 'Responsive redesign for the Office of Sustainability.', NULL, NULL, NULL, '2016-07-24 14:56:25', '2016-07-24 14:56:25', '86d686a5-cb8b-4d8d-a867-67cbbd7a1e1b'),
 ('28', '28', 'en_us', 'Iowa Hawk Shop', NULL, '#000000', NULL, '', '[\"design\",\"emailMarketing\",\"htmlCss\",\"seo\"]', 'Responsive ecommerce redesign for Iowa\'s textbook and apparel store.', NULL, NULL, NULL, '2016-07-24 14:56:59', '2016-07-24 14:56:59', '833ef9d9-cc84-4ba7-821f-3d371d142b8a'),
 ('29', '29', 'en_us', 'Bijou Film Board', NULL, '#000000', NULL, 'https://bijou.uiowa.edu/', '[\"cmsIntegration\",\"design\",\"htmlCss\"]', 'A new website for one of the preeminent student-run cinemas in the nation.', NULL, NULL, NULL, '2016-07-24 14:57:36', '2016-07-24 14:57:36', '484f15ef-fbbe-49db-a91a-2eae27cea48e'),
 ('30', '30', 'en_us', 'Student Life Annual Report', NULL, '#000000', NULL, 'https://report.studentlife.uiowa.edu', '[\"cmsIntegration\",\"design\",\"htmlCss\"]', 'A new responsive website showcasing articles from the Division of Student Life.', NULL, NULL, NULL, '2016-07-24 14:58:14', '2016-07-24 14:58:14', 'b2a6d8b2-f2c9-4d8d-8bc5-19b5d156c0af'),
 ('31', '31', 'en_us', 'Friday Links', '<p><strong>Craft CMS</strong><br /><a href=\"https://craftcms.com/\">https://craftcms.com/</a></p>\n\n<p><strong>Certbot</strong><br />Automatically enable HTTPS on your website with EFF’s Certbot, deploying Let’s Encrypt certificates.<br /><a href=\"https://certbot.eff.org/\">https://certbot.eff.org/</a></p>\n\n\n\n<p><strong>Centered Logos Hurt Website Navigation</strong><br />Getting back to the homepage is about 6 times harder when the logo is placed in the center of a page compared to when it’s in the top left corner.<br /><a href=\"https://www.nngroup.com/articles/centered-logos/\">https://www.nngroup.com/articl...</a></p>\n\n\n\n<p><strong>Auto-Hiding Navigation</strong><br /><a href=\"https://codyhouse.co/gem/auto-hiding-navigation/\">https://codyhouse.co/gem/auto-...</a></p>\n\n\n\n<p><strong>Vox Media Accessibility Guidelines</strong><br /><a href=\"http://accessibility.voxmedia.com/\">http://accessibility.voxmedia....</a></p>', NULL, NULL, NULL, '[]', '', NULL, NULL, NULL, '2016-07-24 15:12:03', '2016-07-25 02:03:17', 'b01a8346-a7e2-408d-ac56-347cc847ab3b'),
 ('32', '32', 'en_us', 'Friday Links', '<p><strong>Type Terms. The animated typographic cheat sheet.</strong><br /><a href=\"https://www.supremo.tv/typeterms/\" target=\"_blank\">https://www.supremo.tv/typeterms/</a></p>\n\n<p><strong>A Comprehensive Guide to Font Loading Strategies</strong><br /><a href=\"https://www.zachleat.com/web/comprehensive-webfonts/\" target=\"_blank\">https://www.zachleat.com/web/comprehensive-webfonts/</a></p>\n\n\n\n<p><strong>A Front End Developer is Aware</strong><br /><a href=\"https://css-tricks.com/front-end-developer-aware/\" target=\"_blank\">https://css-tricks.com/front-end-developer-aware/</a></p>\n\n\n\n<p><strong>Introducing the all-new Inside Intercom</strong><br /><a href=\"https://blog.intercom.io/introducing-new-inside-intercom/\" target=\"_blank\">https://blog.intercom.io/introducing-new-inside-intercom/</a></p>\n\n\n\n<p><strong>Has Design Become Too Hard?</strong><br /><a href=\"http://www.commarts.com/column/has-design-become-too-hard\" target=\"_blank\">http://www.commarts.com/column/has-design-become-too-hard</a></p>', NULL, NULL, NULL, '[]', '', NULL, NULL, NULL, '2016-07-24 15:16:01', '2016-07-25 02:03:42', '1988bd33-8d9c-4a63-9752-2b809bef3102'),
 ('33', '34', 'en_us', 'Photos', '<h1>Photos from around the world</h1>\n\n<p>I\'ve been traveling since college, although not as much as I used to. I love everything about it – different cultures, inspiring people, adventures, and landscapes that leave me speachless. Here are a few photos from some of the amazing places I\'ve been to.</p>', NULL, NULL, NULL, '[]', NULL, NULL, NULL, NULL, '2016-07-24 17:43:17', '2016-07-25 01:20:43', '3666a105-9d18-47c4-8dd7-08122c48284f'),
 ('34', '35', 'en_us', 'Machu Picchu', NULL, NULL, NULL, NULL, '[]', NULL, NULL, NULL, NULL, '2016-07-24 17:59:40', '2016-07-24 17:59:40', '1b14057e-34af-4e1f-82a0-7014be4eefce'),
 ('35', '36', 'en_us', 'Iceland Walk', NULL, NULL, NULL, NULL, '[]', NULL, NULL, NULL, NULL, '2016-07-24 18:00:16', '2016-07-24 18:00:16', '7cea8c0a-4eb4-477a-ba61-cc4dbc49f7b4'),
